import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Home = () => {
    return (
        <View style={styles.home_}>
            <View style={styles.home_box}>
            <View></View>
            <View></View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    home_: {
        width: "100vw",
        height: '100vh',
        backgroundColor: "#fff",
    },
    home_box: {
        width: '95vw',
        height: '90vh',
        backgroundColor: "#fff",
        margin: 'auto'
    }
})

export default Home;
